package ar.edu.itba.geb.compiler.java.syntaxtree;import ar.edu.itba.geb.compiler.java.visitors.TypeVisitor;import ar.edu.itba.geb.compiler.java.visitors.Visitor;public class MethodDecl {  public Type methodReturnT;  public Identifier methodNameId;  public FormalList formalParamList;  public VarDeclList localVarList;  public StatementList statementList;  public Exp returnExpr;  public MethodDecl(Type at, Identifier ai, FormalList afl, VarDeclList avl, StatementList asl, Exp ae) {    methodReturnT = at;    methodNameId = ai;    formalParamList = afl;    localVarList = avl;    statementList = asl;    returnExpr = ae;  }  public void accept(Visitor v) {    v.visit(this);  }  public Type accept(TypeVisitor v) {    return v.visit(this);  }}